import React, { Component } from "react";

export default class Index extends Component {
  render() {
    return (
      <div>
        <div className="imagen">
          <img src="https://media-exp1.licdn.com/dms/image/C4D03AQGwHQirvTBv9w/profile-displayphoto-shrink_400_400/0?e=1609977600&v=beta&t=XFJKez042YbiVKDwmyzHrC7zcpWr8gZsiU1BwSU9dDs" />
        </div>
        <div>
        <h1>Gonzalo Martín Cano</h1>
        <h2>FULL STACK DEVELOPER</h2>
        <p>"Lo más parecido a poder volar, es saber programar"</p>

        </div>
      </div>
    );
  }
}
